							if (ov_string_compare(*(OV_STRING*)table->table[i][j], findRowValues.value[j]) == OV_STRCMP_EQUAL){
								matchingRows.value[numberOfMatchingRows] = i;
								numberOfMatchingRows = numberOfMatchingRows + 1;
							}
